namespace ForumSystem.Data.Seeding
{
    using System;
    using System.Collections.Generic;
    using System.Linq;
    using System.Threading.Tasks;

    public class CategoriesSeeder : ISeeder
    {
        public async Task SeedAsync(ApplicationDbContext dbContext, IServiceProvider serviceProvider)
        {
            if (dbContext.Categories.Any())
            {
                return;
            }

            var categories = new List<(string Name, string ImageUrl)>
            {
                ("Sport","data:image/jpeg;base64,"),
                ("Coronavirus","data:image/jpeg;base64,"),
                ("News","data:image/png;base64,"),
                ("Music","data:image/jpeg;base64,"),
                ("Programming","data:image/jpeg;base64,"),
                ("Cats","data:image/jpeg;base64,"),
                ("Dogs","data:image/jpeg;base64,"),
            };

            foreach (var category in categories)
            {
                await dbContext.Categories.AddAsync(new Models.Category
                {
                    Name = category.Name,
                    Description = category.Name,
                    Title = category.Name,
                    ImageUrl = category.ImageUrl,
                });
            }
        }
    }
}
